import React from "react";
import logo from './Moss1.jpg';
import logo2 from './Moss2.jpg';

function Projects() {
    return (
        <div>
            <header>
                <h1 className="chicago">Projects</h1>
                <h2 className="chicago" style="text-align:left">Virtual Art Gallery</h2>
                <p className="chicago">
                    For my Human-Computer Interaction for my Bachelor's degree
                </p>
                <img src={logo} className="App-logo" alt="logo" />
                <img src={logo2} className="App-logo" alt="logo" />
                <a
                    className="App-link"
                    href="https://www.youtube.com/channel/UCvCvbkzjVlBV27hTX-T2org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    <div className="chicago">Animation Channel</div>
                </a>
            </header>
        </div>
    );
}

export default Projects;
